#define PI 3.14159

#define DEG_TO_RAD 0.0174532925
#define X_MIDDLE 120
#define Y_MIDDLE 130
//#define PI 3.1415
#define RADIUS_LONG 87
#define RADIUS_SHORT 60
#define RADIUS_MIDDLE 68

#define RADIUS_COMPASS_MAIN_SHORT 90
#define RADIUS_COMPASS_MAIN_MIDDLE 103
#define RADIUS_COMPASS_MAIN_LONG 112

#define RADIUS_COMPASS_SECONDARY_SHORT 93
#define RADIUS_COMPASS_SECONDARY_MIDDLE 103
#define RADIUS_COMPASS_SECONDARY_LONG 112

#define ARROW_COLOR GUI_RED
#define BACKGROUND_COLOR	GUI_WHITE
#define COMPASS_COLOR GUI_BLACK

