void MainTask(void)
{
	BUTTON_Handle hCompassBt, hCalibrationBt;
	
	hCompassBt = BUTTON_CreateEx(40, 100, 64, 64, 0, WM_CF_SHOW, 0, GUI_ID_BUTTON0);
	BUTTON_SetBitmap(hCompassBt, BUTTON_BI_UNPRESSED, &bmcompass);
	
	hCalibrationBt = BUTTON_CreateEx(136, 100, 64, 64, 0, WM_CF_SHOW, 0, GUI_ID_BUTTON1);
	BUTTON_SetBitmap(hCalibrationBt, BUTTON_BI_UNPRESSED, &bmsettings);
	
	GUI_SetBkColor(BACKGROUND_COLOR);
	GUI_Exec();
	
	while(1)
	{

		if(BUTTON_IsPressed(hCompassBt))
		{
			BUTTON_Delete(hCompassBt);
			BUTTON_Delete(hCalibrationBt);
			GUI_ClearRect(0, 0, 240, 320);
			BSP_LED_On(LED3);
			GUI_Exec();
			CreateCompassWindow2();
		}
		
		else if(BUTTON_IsPressed(hCalibrationBt))	
		{
			BUTTON_Delete(hCalibrationBt);
			BUTTON_Delete(hCompassBt);
			GUI_ClearRect(0, 0, 240, 320);
			BSP_LED_Off(LED3);
			GUI_Exec();
			//CreateCalibrationWindow2();
			CreateMaskBitmap();
		}
		GUI_Delay(100);
	}
}

static void CreateCompassWindow2(void)
{
	BUTTON_Handle hBackBt;
	hBackBt = BUTTON_CreateEx(10, 250, 64, 64, 0, WM_CF_SHOW, 0, GUI_ID_BUTTON0);
	//BUTTON_SetText(hBackBt, "Back");
  //BUTTON_SetFont(hBackBt, &GUI_Font8x15B_ASCII);
	BUTTON_SetBitmap(hBackBt, BUTTON_BI_UNPRESSED, &bmimages);
	uint16_t i = 0;
	double heading = 0;
	
	GUI_SetColor(COMPASS_COLOR);
	for(unsigned int i = 0; i<10; i++)
	{
		GUI_DrawCircle(120, 130, 103+i);
	}
	drawMainDirection(0);
	drawMainDirection(90);
	drawMainDirection(180);
	drawMainDirection(270);
	drawSecondaryDirection(30);
	drawSecondaryDirection(60);
	drawSecondaryDirection(120);
	drawSecondaryDirection(150);
	drawSecondaryDirection(210);
	drawSecondaryDirection(240);
	drawSecondaryDirection(300);
	drawSecondaryDirection(330);
	
	GUI_Exec();
	GUI_Delay(10);
	COMPASS_Init();
	
	while(1)
	{
		if(BUTTON_IsPressed(hBackBt))
		{
			BUTTON_Delete(hBackBt);
			GUI_ClearRect(0, 0, 240, 320);
			COMPASS_DeInit();
			MainTask();
		}
		else
		{
			if(COMPASS_OK == COMPASS_GetHeading(&heading))
			{
				
				COMPASS_Status_T statusCompass = COMPASS_OK;
				GUI_ClearRect(110, 109, 140, 129);
			
				GUI_SetFont(&GUI_Font8x16);
				GUI_DispDecAt(statusCompass, 120, 250, 1);
				GUI_DispDecAt(heading, 110, 130, 3);
				
				
				drawArrow(360-heading);
				if(heading >= 338 || heading <= 23) 
					GUI_DispStringAt("N", 110, 109);
				else if(heading >= 24 && heading <= 68)
					GUI_DispStringAt("NE", 110, 109);
				else if(heading >= 69 && heading <= 113)
					GUI_DispStringAt("E", 110, 109);
				else if(heading >= 114 && heading <= 158)
					GUI_DispStringAt("SE", 110, 109);
				else if(heading >= 159 && heading <= 203)
					GUI_DispStringAt("S", 110, 109);
				else if(heading >= 204 && heading <= 248)
					GUI_DispStringAt("SW", 110, 109);
				else if(heading >= 249 && heading <= 293)
					GUI_DispStringAt("W", 110, 109);
				else if(heading >= 294 && heading <= 338)
					GUI_DispStringAt("NW", 110, 109);
			
			}
			else
			{
				BSP_LED_Toggle(LED3);
			}
		}
		GUI_Delay(95);//
	}
}

static void drawArrow(uint16_t j)
{
	unsigned int XA, YA, XB, YB, XC, YC, XD, YD;
	float fi = 0.0;
	static GUI_POINT points[4];
	static GUI_POINT oldPoints[4];
	

	fi = j * DEG_TO_RAD;
	XA = (RADIUS_LONG * cosf(fi - PI/2)) + X_MIDDLE;
	YA = (RADIUS_LONG * sinf(fi - PI/2)) + Y_MIDDLE;
	
	XB = (RADIUS_SHORT * cosf(fi - (PI/2 + PI/18))) + X_MIDDLE;
	YB = (RADIUS_SHORT * sinf(fi - (PI/2 + PI/18))) + Y_MIDDLE;

	XC = (RADIUS_MIDDLE * cosf(fi - PI/2)) + X_MIDDLE;
	YC = (RADIUS_MIDDLE * sinf(fi - PI/2)) + Y_MIDDLE;
	
	XD = (RADIUS_SHORT * cosf(fi - (PI/2 - PI/18))) + X_MIDDLE;
	YD = (RADIUS_SHORT * sinf(fi - (PI/2 - PI/18))) + Y_MIDDLE;

	points[0].x = XA;
	points[0].y = YA;

	points[1].x = XB;
	points[1].y = YB;
	
	points[2].x = XC;
	points[2].y = YC;
	
	points[3].x = XD;
	points[3].y = YD;
	
	GUI_SetColor(BACKGROUND_COLOR);
	GUI_FillPolygon(oldPoints, 4, 0, 0);
	
	GUI_SetColor(ARROW_COLOR);
	GUI_FillPolygon(points, 4, 0, 0);
	
	for(unsigned int i = 0; i<4; i++)
	{
		oldPoints[i] = points[i];
	}
		
}		

static void drawMainDirection(uint16_t degree)
{
	unsigned int XA, YA, XB, YB, XC, YC, XD, YD;
	float fi = 0.0;
	static GUI_POINT points[4];
	
	fi = degree * DEG_TO_RAD;
	
	XA = (RADIUS_COMPASS_MAIN_SHORT * cosf(fi - PI/2)) + X_MIDDLE;
	YA = (RADIUS_COMPASS_MAIN_SHORT * sinf(fi - PI/2)) + Y_MIDDLE;
	
	XB = (RADIUS_COMPASS_MAIN_LONG * cosf(fi - (PI/2 + PI/12))) + X_MIDDLE;
	YB = (RADIUS_COMPASS_MAIN_LONG * sinf(fi - (PI/2 + PI/12))) + Y_MIDDLE;
	
	XC = (RADIUS_COMPASS_MAIN_MIDDLE * cosf(fi - PI/2)) + X_MIDDLE;
	YC = (RADIUS_COMPASS_MAIN_MIDDLE * sinf(fi - PI/2)) + Y_MIDDLE;
	
	XD = (RADIUS_COMPASS_MAIN_LONG * cosf(fi - (PI/2 - PI/12))) + X_MIDDLE;
	YD = (RADIUS_COMPASS_MAIN_LONG * sinf(fi - (PI/2 - PI/12))) + Y_MIDDLE;
	
	points[0].x = XA;
	points[0].y = YA;

	points[1].x = XB;
	points[1].y = YB;
	
	points[2].x = XC;
	points[2].y = YC;
	
	points[3].x = XD;
	points[3].y = YD;
	
	GUI_SetColor(COMPASS_COLOR);
	GUI_FillPolygon(points, 4, 0, 0);
}

static void drawSecondaryDirection(uint16_t degree)
{
	unsigned int XA, YA, XB, YB, XC, YC, XD, YD;
	float fi = 0.0;
	static GUI_POINT points[4];
	
	fi = degree * DEG_TO_RAD;
	
	XA = (RADIUS_COMPASS_SECONDARY_SHORT * cosf(fi - PI/2)) + X_MIDDLE;
	YA = (RADIUS_COMPASS_SECONDARY_SHORT * sinf(fi - PI/2)) + Y_MIDDLE;
	
	XB = (RADIUS_COMPASS_SECONDARY_LONG * cosf(fi - (PI/2 + PI/23))) + X_MIDDLE;
	YB = (RADIUS_COMPASS_SECONDARY_LONG * sinf(fi - (PI/2 + PI/23))) + Y_MIDDLE;
	
	XC = (RADIUS_COMPASS_SECONDARY_MIDDLE * cosf(fi - PI/2)) + X_MIDDLE;
	YC = (RADIUS_COMPASS_SECONDARY_MIDDLE * sinf(fi - PI/2)) + Y_MIDDLE;
	
	XD = (RADIUS_COMPASS_SECONDARY_LONG * cosf(fi - (PI/2 - PI/23))) + X_MIDDLE;
	YD = (RADIUS_COMPASS_SECONDARY_LONG * sinf(fi - (PI/2 - PI/23))) + Y_MIDDLE;
	
	points[0].x = XA;
	points[0].y = YA;

	points[1].x = XB;
	points[1].y = YB;
	
	points[2].x = XC;
	points[2].y = YC;
	
	points[3].x = XD;
	points[3].y = YD;
	
	GUI_SetColor(COMPASS_COLOR);
	GUI_FillPolygon(points, 4, 0, 0);
}

static void CreateCalibrationWindow2(void)
{
	BUTTON_Handle hBackBt;
	int16_t mag_reading[2];
	int16_t mag_x[2] = {300, 0};
	int16_t mag_y[2] = {300, 0};
	MAG_Status_T statusMAG = MAG_OK;
	
	GUI_SetFont(&GUI_Font8x16);
	PROGBAR_Handle hProgbar;
	hProgbar = PROGBAR_CreateEx(10, 10, 220, 30, 0, WM_CF_SHOW, 0, GUI_ID_PROGBAR0);
	PROGBAR_SetFont(hProgbar, &GUI_Font8x16);
	PROGBAR_SetText(hProgbar, "LOADING..CZEKAJ..");
	PROGBAR_SetMinMax(hProgbar, 0, 200);
	uint16_t i = 0;
	
	GUI_DispDecAt(mag_x[0], 120, 100, 4);
	GUI_DispDecAt(mag_x[1], 120, 120, 4);
	GUI_DispDecAt(mag_y[0], 120, 140, 4);
	GUI_DispDecAt(mag_y[1], 120, 160, 4);
	GUI_DispDecAt(i, 120, 200, 4);
	
	GUI_Exec();
	GUI_Delay(10);
	
	GUI_SetBkColor(BACKGROUND_COLOR);
	COMPASS_Init();
	

	while(1)
	{
		if(BUTTON_IsPressed(hBackBt) && i>200 )
				{
					BUTTON_Delete(hBackBt);
					GUI_ClearRect(0, 0, 240, 320);
					COMPASS_DeInit();
					PROGBAR_Delete(hProgbar);
					MainTask();
				}
		else
		{
			if(i<=200)
			{
				PROGBAR_SetValue(hProgbar, i);
				MAGNETO_StartForcedMeasure();
				statusMAG |= MAGNETO_ReadAxis(MAG_X_AXIS, &mag_reading[0]);
				statusMAG |= MAGNETO_ReadAxis(MAG_Y_AXIS, &mag_reading[1]);
				
				if(mag_reading[0] > mag_x[1]) //sprawdzenie czy aktualna jest wieksza od najwiekszej
					mag_x[1] = mag_reading[0];
				
				if(mag_reading[0] < mag_x[0]) //sprawdzenie czy aktualna jest mniejsza od najmniejszej
					mag_x[0] = mag_reading[0];
				
				if(mag_reading[1] > mag_y[1])
					mag_y[1] = mag_reading[1];
				
				if(mag_reading[1] < mag_y[0])
					mag_y[0] = mag_reading[1]; 
				
				i++;
				GUI_DispDecAt(mag_x[0], 120, 100, 4);
				GUI_DispDecAt(mag_x[1], 120, 120, 4);
				GUI_DispDecAt(mag_y[0], 120, 140, 4);
				GUI_DispDecAt(mag_y[1], 120, 160, 4);
				GUI_DispDecAt(i, 120, 200, 4);
			}
			else if(i==201)
			{
				hBackBt = BUTTON_CreateEx(10, 250, 64, 64, 0, WM_CF_SHOW, 0, GUI_ID_BUTTON0);
				//BUTTON_SetText(hBackBt, "Back");
				//BUTTON_SetFont(hBackBt, &GUI_Font8x15B_ASCII);
				BUTTON_SetBitmap(hBackBt, BUTTON_BI_UNPRESSED, &bmimages);
				PROGBAR_Delete(hProgbar);
				
				x_error = (mag_x[0] + mag_x[1]) * 0.5;
				y_error = (mag_y[0] + mag_y[1]) * 0.5;
				
				GUI_DispDecAt(x_error, 120, 240, 4);
				GUI_DispDecAt(y_error, 120, 260, 4);
				i++;	
			}
		}
		GUI_Delay(99); //99
	}
}

